import React from "react";
import { Link } from "react-router-dom";

function Navigation() {
  return (
    <nav className="navigation">
      <Link to="/" className="navigation__link">
        Inicio
      </Link>
      {/* Other links... */}
    </nav>
  );
}

export default Navigation;
